import React from 'react';

function App() {

	const onSubmit = () => {
		alert('hello');
	}

	const onKeyUp = (event) => {
		if (event.keyCode === 13) {
			onSubmit();
		}
	}

	let text = 'Hello1';

	return (
		<div className="App">
			<input onKeyUp={onKeyUp} />
			<button onClick={onSubmit}>Sumit</button>

			<br/>
			<br/>

			<span>{text}</span>
			<button>Update</button>
		</div>
	);
}

export default App;
